import React from "react";
import Employee from "./Employee";
import Footer from "./layout/footer";
import Header from "./layout/header";
// import Users from "./Users";

function App() {
  return (
    <div className="App">
      <Header/>
        <main>
          <div className='container'>
            <Users />
            <Employee />
          </div>
        </main>
      <Footer />
    </div>
  );
}

export default App;
